import React from 'react'
import MenuItem from './MenuItem/MenuItem'

const Directory = () => {

    const categories = [
        {
            title:"Flowers",
            imageUrl:"https://res.cloudinary.com/dzdvrgbjd/image/upload/v1601139926/masks_flowers/IMG_4957_pb8qzx.jpg",
            linkUrl:"flowers"
        },
        {
            title:"People",
            imageUrl:"https://res.cloudinary.com/dzdvrgbjd/image/upload/a_90/v1601138712/masks_people/IMG_0729_bhjf3x.jpg",
            linkUrl:"people"
        },
        {
            title:"Birds & Butterflies",
            imageUrl:"https://res.cloudinary.com/dzdvrgbjd/image/upload/v1601139340/masks_birds_butterflies/IMG_4738_kxur2x.jpg",
            linkUrl:"birds"
        }
    ]

    return (
        <div>
            <div className='directory-menu'>
            {
                categories.map(({id, ...otherCategoryProps}) => (
                    <MenuItem key={id} {...otherCategoryProps} />
                ))
            }
            </div>
        </div>
    )
}

export default Directory
